import React from "react";
import "../bulma/css/bulma.min.css";
import "../App.css";
import { useEffect } from "react";
import { useState } from "react";
//import { SvgXml } from "react-native-svg";

function TrustedLeadingBrandsAPI() {
  const parse = require("html-react-parser");

  const [data, setData] = useState([]);

  const apiGet = () => {
    fetch("http://127.0.0.1:5000/api_get_trusted_leading_brands")
      .then((respose) => respose.json())
      .then((json) => {
        console.log(json);
        setData(json);
      });
  };

  useEffect(() => {
    apiGet();
  }, []);

  const myData = data;

  return (
    <div>
      <h2>Sort and Filter component</h2>
      <div class="dropdown is-right is-active">
        <div class="dropdown-trigger">
          <button class="button" aria-controls="dropdown-menu6">
            <span>Filter</span>
            <span class="icon is-small">
              <i class="fas fa-angle-down" aria-hidden="true"></i>
            </span>
          </button>
        </div>
        <div class="dropdown-menu" id="dropdown-menu6" role="menu">
          <div class="dropdown-content">
            <div class="dropdown-item">
              <p>
                Add the <code>is-right</code> modifier for a{" "}
                <strong>right-aligned</strong> dropdown.
              </p>
            </div>
          </div>
        </div>
      </div>
      <div class="dropdown is-right is-active">
        <div class="dropdown-trigger">
          <button class="button" aria-controls="dropdown-menu6">
            <span>Sort</span>
            <span class="icon is-small">
              <i class="fas fa-angle-down" aria-hidden="true"></i>
            </span>
          </button>
        </div>
        <div class="dropdown-menu" id="dropdown-menu6" role="menu">
          <div class="dropdown-content">
            <div class="dropdown-item">
              <p>Company Name Ascending</p>
              <p>Company Name Descending</p>
              <p>Industry Type Ascending</p>
              <p>Industry Type Descending</p>
            </div>
          </div>
        </div>
      </div>

      <div class="TrustedBrandsIconContainer">
        {myData.map((myData) => (
          <div className="TrustedBrandsIcon">
            {parse(myData.brand_image_tb01)}
          </div>
        ))}
      </div>
    </div>
  );

  /*
  return (
    <div>
      <div>
        MY API
        <br />
      </div>
      <div>
        {data.map((item) => (
          <div>
            <Convert string={item.brand_image_tb01} />
          </div>
        ))}
      </div>
      <div></div>
    </div>
  );*/
}

export default TrustedLeadingBrandsAPI;

